INSERT INTO `soal` VALUES   ('1','1','1','<div class=\"freebirdFormviewerComponentsQuestionBaseHeader\">\r\n<div class=\"freebirdFormviewerComponentsQuestionBaseTitleDescContainer\">\r\n<div id=\"i1\" class=\"freebirdFormviewerComponentsQuestionBaseTitle exportItemTitle freebirdCustomFont\" role=\"heading\" aria-level=\"3\" aria-describedby=\"i4\">pasangan larutan yang merupakan elektrolit kuat dan non elektrolit secara berturut-turut yang tepat adalah...<span id=\"i4\" class=\"freebirdFormviewerComponentsQuestionBaseRequiredAsterisk\" aria-label=\"Pertanyaan wajib\">&nbsp;</span></div>\r\n</div>\r\n</div>','1','<p>Cuka dan Gula</p>','<p>NaOH dan cuka</p>','<p>air aki dan Gula</p>','<p>HBr dan Urea</p>','<p>Minyak dan Gula</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('2','1','2','<p>larutan garam dapur jika di uji dengan alat uji elektrolit listrik akan menghasilkan pengamatan nyala lampu yang kurang lebih sama dengan larutan..</p>','1','<p>cuka</p>','<p>gula</p>','<p>air aki</p>','<p>urea</p>','<p>minyak goreng</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('3','1','3','<p>Hasil uji daya hantar listrik sampel larutan limbah didapati bahwa lampu tidak menyala, tetapi terdapat sedikit gelembung gas. Larutan limbah ini termasuk jenis larutan...<span id=\"i42\" class=\"freebirdFormviewerComponentsQuestionBaseRequiredAsterisk\" aria-label=\"Pertanyaan wajib\">&nbsp;</span></p>','1','<p>non elektrolit, karena lampu tidak menyala</p>','<p>elektrolit kuat, karena hanya menghasilkan gelembung gas</p>','<p>nonelektrolit, karena hanya menghasilkan gelembung gas</p>','<p>Elektrolit kuat, karena lampu tidak menyala</p>','<p>elektrolit lemah, karena hanya menghasilkan gelembung gas</p>','E','','','','','','','');
