INSERT INTO `soal` VALUES ('7','1','7','<p>Pernyataan berikut yang tepat mengenai bahan yang digunakan dalam air aki (H<sub>2</sub>SO<sub>4</sub>) adalah...<span id=\"i23\" class=\"freebirdFormviewerComponentsQuestionBaseRequiredAsterisk\" aria-label=\"Pertanyaan wajib\">&nbsp;</span></p>','1','<p>Dalam air terionisasi sempurna</p>','<p>bersifat non elektrolit</p>','<p>Tidak mengalami ionisasi dalam air</p>','<p>Merupakan elektrolit lemah</p>','<p>mengandung senyawa basa</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('8','1','8','<p>Perhatikan beberapa sifat senyawa berikut!</p>\r\n<ol>\r\n<li>Tidak Terionisasi</li>\r\n<li>Tidak terdapat molekul dalam larutannya</li>\r\n<li>Dapat menghantarkan arus listrik</li>\r\n<li>Tidak menghasilkan gelembung gas</li>\r\n</ol>\r\n<p>Sifat Larutan NaCl (garam dapur) terdapat pada nomor.....</p>','1','<p>1 dan 2</p>','<p>2 dan 4</p>','<p>2 dan 3</p>','<p>3 dan 4</p>','<p>4 dan 1</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('9','1','9','<p>Larutan gula tidak memberikan nyala lampu ketik di uji dengan alat uji daya hantar listrik larutan. Pernyataan yang benar berkaitan dengan fakta ini adalah..</p>','1','<p>Gula larut dalam air tetapi tidak terionisasi</p>','<p>Gula tidak larut dalam air</p>','<p>Gula menghambat ionisasi air</p>','<p>Gula terionisasi sebagian menjadi ion gula</p>','<p>Gula mengalami hidrolisis</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('10','1','10','<p>Reaksi ionisasi senyawa berikut yang benar adalah...</p>','1','<p><span style=\"font-size: 12pt;\">CaCl<sub>2</sub>&nbsp;<img class=\"fm-editor-equation\" src=\"data:image/png;base64,\" data-mlang=\"latex\" data-equation=\"%5Crightarrow\" />&nbsp;Ca<sup>2+</sup> + Cl<sup>-</sup></span></p>','<p><span style=\"font-size: 12pt;\">NaCl&nbsp;<img class=\"fm-editor-equation\" src=\"data:image/png;base64,\" data-mlang=\"latex\" data-equation=\"%5Crightarrow\" />&nbsp;Na<sup>2+</sup> + Cl<sup>-</sup></span></p>','<p><span style=\"font-size: 12pt;\">Al<sub>2</sub>O<sub>3</sub>&nbsp;<img class=\"fm-editor-equation\" src=\"data:image/png;base64,\" data-mlang=\"latex\" data-equation=\"%5Crightarrow\" />&nbsp;2Al<sup>3+</sup> + 3O<sup>2-</sup></span></p>','<p><span style=\"font-size: 12pt;\">H<sub>2</sub>SO<sub>4</sub>&nbsp;<img class=\"fm-editor-equation\" src=\"data:image/png;base64,\" data-mlang=\"latex\" data-equation=\"%5Crightarrow\" />&nbsp;2H<sup>+</sup> + 4SO<sub>4</sub><sup>2-</sup></span></p>','<p><span style=\"font-size: 12pt;\">AlCl<sub>3</sub>&nbsp;<img class=\"fm-editor-equation\" src=\"data:image/png;base64,\" data-mlang=\"latex\" data-equation=\"%5Crightarrow\" />&nbsp;3Al<sup>3+</sup> + Cl<sup>-</sup></span></p>','C','','','','','','','');
